import React from "react";

function List({ list }) {
  return (
    <div>
      <h1>{list.name}</h1>
      <p>{list.created_at}</p>
      <ul>
        {list.items.map(item => (
          <li key={item.id}>
            <span>{item.name}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default List;
